snippet.textDisplay:
This is what happens when a strong artist (Talking of Shuja) gets his chances. Such a sure footed beginning to the season. Ahmed Jehanzeb is so powerful! Shafqat is a force to reckon with in studio singing anyway. Layered composition with so much depth and such a mellow setting..Mashallah! Excellent houseband at play...yet again! Happy 10th CokeStudio Pakistan..thank you for being quietly brilliant and melodious in equal measure.

Love from India, season beginning se season ke end tak and then beyond as well
@Rohwit

